import { Segment, Header, TextArea, Form, Divider } from "semantic-ui-react";

const OrderReceived = () => (
  <Segment style= {{marginTop: 20}}>
    <Header>Review McDonalds</Header>
    <Form>
      <TextArea placeholder="Positive/negative comments about the food..." />
    </Form>
    <Divider />
    
  </Segment>
);

export default OrderReceived;
